      | 365578 -> { ItemTypeData.id= 365578; name= "Kaalakiota Bolt Pistol"; published= false; description= "The result of years of R&D, the bolt pistol is a high-impact handgun capable of firing kinetic projectiles with pinpoint accuracy. Building upon its copious experience with microscale rail weaponry, Kaalakiota has further refined the technology to produce what is commonly regarded as the most powerful handgun on the market.    Central to its success is a smart sensor that bleeds off a minute amount of dropsuit energy at the moment of discharge, dissipating the sharp recoil impulse through the suit’s internal membrane and greatly reducing the peak force of each shot. This seemingly minor innovation is what makes accurate fire of the weapon possible without the need for an external mounting."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
