      | 47612 -> { ItemTypeData.id= 47612; name= "Caracal Octopus Orange Flight SKIN"; published= true; description= "The Caldari Navy's 37th (Octopus) Squadron has a long and storied history stretching back to the Caldari-Gallente War that led to independence for the Caldari State. Originally a frigate squadron established during the war, the 37th is notable as a capsuleer unit within the Caldari Navy.    Octopus Squadron's  Orange Flight  is an outgrowth of the older  Red Flight  after reorganization of this elite capsuleer squadron. The Orange Flight operates advanced missile cruisers in the heavy assault role, providing devastating and flexible long-range firepower to the 37th."; marketGroupId= Some(1991); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 47806 -> { ItemTypeData.id= 47806; name= "Unstable Large Shield Extender Mutaplasmid"; published= true; description= "This bioadaptive mutaplasmid tool is designed to interface with and alter supplemental shield enhancement systems. As such this mutaplasmid could be used to mutate the performance characteristics of most shield extenders in the correct size class.    Triglavian bioadaptive technology makes extensive use of engineered colonies of extremophilic bacteria, that are used to grow, harvest and adapt various resources found in Abyssal Deadspace. Artificial colonizing plasmids integrated into specialist tools used for direct adaptation of technology can be found in Triglavian caches in various stages of development. These mutaplasmids can be used to alter the characteristics of a wide variety of equipment types, depending on the strain and the bioadaptive tool with which they are integrated.    The mutaplasmid colony integrated into this bioadaptive tool is highly unstable, with a high rate of reproduction and mutation. The mutational benefits of using this mutaplasmid are potentially very high but the risks are also extreme."; marketGroupId= Some(2448); groupId= 1964; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
      | 47903 -> { ItemTypeData.id= 47903; name= "Chaotic Gamma Filament"; published= true; description= "This Abyssal Filament will pull a <b>Tech I or Tech II Cruiser</b> into a pocket of Abyssal Deadspace experiencing <b>chaotic and destabilizing effects</b>, and bathed in the radioactive afterglow of a gamma-ray burst that will <b>reduce explosive resistance</b> but <b>enhance ship shield strength</b>.    <b><color=yellow>Warning:</color></b> Abyssal Deadspace is a particularly harsh and unforgiving environment. Entanglement of the warp core with a space-time filament introduces severe deformations of the ship's warp field that cumulatively increase over time. After <b><color=yellow>20 minutes</color></b> catastrophic collapse of the warp field is predicted, with <b><color=yellow>destruction of the ship and capsule</color></b> certain.    A device of Triglavian design that functions as one end of an energetically inert filament of space-time connected to a specific pocket of Abyssal Deadspace. When activated by a ship equipped with a warp core that has the correct mass-energy parameters, the filament becomes a conduit that will draw the activating vessel along it and into the connected deadspace pocket.     The mass-energy exchange involved leaves a highly energetic trace at the ship's origin point and the space-time filament remains entangled with the warp core of the ship that uses it. Triglavian Transfer Conduits will permit such a ship to progress through the deadspace pocket but an Origin Conduit will return the ship to its starting location in normal space."; marketGroupId= Some(2460); groupId= 1979; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 0.100000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 2760; value= 47866.000000 }; { DogmaAttributeValu